import React from 'react'
import CardProduct from './Product'



const Products = () => {

  
  return (
    <>
    <div>
      <Grid justify="center" spacing={3}>
        <Grid item xs={4} md={8} >
        { products.map((kombuchaDrink) => (
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <CardProduct prodducts ={kombuchaDrink} />
          </Grid>
        ))}
        </Grid>
      </Grid>
    </div>
    </>
  )
}

export default Products;
